import React from 'react';
import SHOP_DATA from'./../shop-data/shop-data';

class ShopPage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            collections: SHOP_DATA
        }
    }

    render() {
        return (
            <h1>Shop Page</h1>
        )
    }
}

export default ShopPage;
